import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import './App.css';
import DogList from './DogList';
import dogsData from './data/dogs';

function App() {
  return (
    <div className="App">
      <div>
        <DogList dogs={dogsData}/>
      </div>
    </div>
  );
}

export default App;
